import React, { Component } from "react";
import Layout from "../components/Layout";
import {
  Table,
  Icon,
  Button,
  Form,
  Grid,
  Header,
  Message,
  Segment,
  Input,
  Container
} from "semantic-ui-react";
import { post } from "axios";

class mailInform extends Component {

  render() {
    return (
      <Container style={{width:"800px", padding:40}}>
        <Table basic style={{ width: "500px" }}>


          <Table.Body>
            <Table.Row>
              <Table.Cell textAlign="center">이전 터미널</Table.Cell>
              <Table.Cell>청원HUB</Table.Cell>
            </Table.Row>
            <Table.Row>
              <Table.Cell textAlign="center">다음 터미널</Table.Cell>
              <Table.Cell>해운대Sub</Table.Cell>
            </Table.Row>
            <Table.Row verticalAlign="top">
              <Table.Cell textAlign="center">배송 주소</Table.Cell>
              <Table.Cell verticalAlign="top">부산광역시 해운대구 중동2로 11 해운대구청</Table.Cell>
            </Table.Row>
          </Table.Body>



        </Table>

        <Button color="red" basic onClick={this.exit}>
          닫기
        </Button>
      </Container>
    );
  }
}

export default mailInform;
